<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="utf-8">
  <meta name="viewport"
    content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0" />
  <meta name="ad.orientation" content="portrait,landscape">
  <!-- <script type="text/javascript" src="https://tpc.googlesyndication.com/pagead/gadgets/html5/api/exitapi.js"></script> -->
  <title>Playable-1</title>

  <style>
    html,
    body {
      width: 100%;
      height: 100%;
    }

    * {
      padding: 0;
      margin: 0;
      -webkit-box-sizing: border-box;
      -moz-box-sizing: border-box;
      box-sizing: border-box;
      -webkit-user-select: none;
      -moz-user-select: none;
      -ms-user-select: none;
      user-select: none;
    }

    body {
      background-color: #222;
      overflow: hidden;
    }

    .game {
      height: 100%;
      width: 100%;
    }

    .level {
      width: 100%;
      height: 100%;
      position: relative;
      z-index: 1;
      overflow: hidden;
    }

    .hand {
      position: absolute;
      width: 8vw;
      z-index: 4000;
      left: 0%;
      top: 0%;
      pointer-events: none;
      opacity: 0;
    }

    /* POPUP */

    #popup {
      display: none;
      position: fixed;
      z-index: 100;
      top: 50%;
      left: 50%;
      z-index: 300;
      -webkit-transform: translate(-50%, -50%);
      -ms-transform: translate(-50%, -50%);
      -moz-transform: translate(-50%, -50%);
      -o-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
      text-align: center;
      width: 100%;
      height: 80%;
      max-width: 60%;
      background: center / cover no-repeat;
      /* background: url("Assets/popup-bg.jpg") center / cover no-repeat; */
      color: #333;

      padding: 30px;
      font-size: 3em;
      -webkit-border-radius: 10px;
      -moz-border-radius: 10px;
      border-radius: 10px;
      -webkit-box-shadow: 0 0 15px rgba(0, 0, 0, 0.5);
      -moz-box-shadow: 0 0 15px rgba(0, 0, 0, 0.5);
      box-shadow: 0 0 15px rgba(0, 0, 0, 0.5);
      overflow: auto;

    }

    @media(max-width: 992px) {
      #popup {
        max-width: 100%;
      }
    }

    @media(max-width: 680px) {
      #popup {
        height: 100%;
      }
    }

    #popup.active {
      display: -webkit-box;
      display: -ms-flexbox;
      display: -webkit-flex;
      display: -moz-box;
      display: flex;
    }

    #popup div {
      width: 100%;
      position: absolute;
      top: 50%;
      left: 50%;
      -webkit-transform: translate(-50%, -50%);
      -moz-transform: translate(-50%, -50%);
      -ms-transform: translate(-50%, -50%);
      -o-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
    }


    #popup img {
      width: 100%;
      max-width: 35vh;
      -webkit-border-radius: 10px;
      -moz-border-radius: 10px;
      border-radius: 10px;
      border: 1px solid #fff;
      margin-bottom: 2vh;
    }

    #popup h2 {
      margin: 2vh 0;
      font-size: 1.3em;
      text-transform: uppercase;
      color: #ffffff;
      font-family: sans-serif;
    }

    #popup button {
      padding: 2vh 3vh;
      color: #624060;
      background: 0 0 /cover no-repeat;
      /* background: url('Assets/button-bg.jpg') 0 0 /cover no-repeat; */
      border: 0;
      cursor: pointer;
      stroke: 0;
      font-size: 1.1em;
      text-transform: uppercase;
      font-weight: 600;
      -webkit-border-radius: 1000px;
      -moz-border-radius: 1000px;
      border-radius: 1000px;
      /* box-shadow: 0 0 20px 1px rgb(203, 72, 207); */
      -webkit-animation: pulse 1s ease 0s infinite alternate;
      -moz-animation: pulse 1s ease 0s infinite alternate;
      -o-animation: pulse 1s ease 0s infinite alternate;
      animation: pulse 1s ease 0s infinite alternate;
      display: block;
      margin: 0 auto;
      margin-top: 2vh;
    }

    @media (max-width:670px) {
      #popup {
        padding: 5vw;
      }

      #popup h2 {
        margin: 2vw 0;
        font-size: 6.5vw;
      }

      #popup button {
        padding: 2vw 3vw;
        font-size: 6vw;
      }
    }

    @-webkit-keyframes pulse {
      0% {
        -webkit-transform: scale(0.95);
        transform: scale(0.95);
      }

      100% {
        -webkit-transform: scale(1);
        transform: scale(1);
      }
    }

    @-moz-keyframes pulse {
      0% {
        -webkit-transform: scale(0.95);
        -moz-transform: scale(0.95);
        transform: scale(0.95);
      }

      100% {
        -webkit-transform: scale(1);
        -moz-transform: scale(1);
        transform: scale(1);
      }
    }

    @-o-keyframes pulse {
      0% {
        -webkit-transform: scale(0.95);
        -o-transform: scale(0.95);
        transform: scale(0.95);
      }

      100% {
        -webkit-transform: scale(1);
        -o-transform: scale(1);
        transform: scale(1);
      }
    }

    @keyframes pulse {
      0% {
        -webkit-transform: scale(0.95);
        -moz-transform: scale(0.95);
        -o-transform: scale(0.95);
        transform: scale(0.95);
      }

      100% {
        -webkit-transform: scale(1);
        -moz-transform: scale(1);
        -o-transform: scale(1);
        transform: scale(1);
      }
    }

    /* LEVEL 1 */

    #level1 {
      background: repeat;
      /* background: url('Assets/bg.jpg') repeat; */
      position: relative;
    }

    #level1 img {
      -o-object-fit: contain;
      object-fit: contain;
    }

    #level1 .main {
      position: absolute;
      width: 100%;
      max-width: 120vh;
      /* max-height: 1043px; */
      /*      height: 100%;*/
      top: 50%;
      left: 50%;
      -webkit-transform: translate(-50%, -50%);
      -ms-transform: translate(-50%, -50%);
      -moz-transform: translate(-50%, -50%);
      -o-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
      display: -webkit-box;
      display: -ms-flexbox;
      display: -webkit-flex;
      display: -moz-box;
      display: flex;
      -webkit-box-align: center;
      -ms-flex-align: center;
      -webkit-align-items: center;
      -moz-box-align: center;
      align-items: center;
    }

    #level1 .carpet {
      width: 100%;
    }


    #level1 .blob {
      position: absolute;
      left: 50%;
      top: 50%;
      -webkit-transform: translate(-50%, -50%);
      -moz-transform: translate(-50%, -50%);
      -ms-transform: translate(-50%, -50%);
      -o-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
      z-index: 10;

      height: 140%;
      width: 66%;
      opacity: 0;
      /* opacity: 0.7; */
    }

    #level1 .fur {
      /* display: none; */
      /*  */
      position: absolute;
      left: 50%;
      top: 50%;
      -webkit-transform: translateX(-50%) translateY(-50%);
      -moz-transform: translateX(-50%) translateY(-50%);
      -ms-transform: translateX(-50%) translateY(-50%);
      -o-transform: translateX(-50%) translateY(-50%);
      transform: translateX(-50%) translateY(-50%);
      z-index: 2;
      width: 92%;
      height: 100%;
      background: rgba(0, 0, 0, 0.3);
    }


    #level1 .tools .tool {
      position: absolute;
      display: none;
      z-index: 1000;
    }

    #level1 .tools .tool .hitbox {
      position: absolute;
      pointer-events: none;

      /* background: rgba(255, 0, 0, 0.5); */
    }

    #level1 .tool img {
      width: 100%;
    }

    #level1 .tools .brush {
      display: block;
      top: 80%;
      left: 45%;
      width: 15%;
    }

    #level1 .tools .brush .hitbox {
      width: 100%;
      height: 5%;
      top: 0;
      left: 0;
    }

    #level1 .tools .hose {
      top: 80%;
      left: 45%;
      width: 6%;
    }

    #level1 .tools .hose .hitbox {
      width: 250%;
      height: 10.9%;
      left: 50%;
      -webkit-transform: translateY(-86%) translateX(-50%);
      -moz-transform: translateY(-86%) translateX(-50%);
      -ms-transform: translateY(-86%) translateX(-50%);
      -o-transform: translateY(-86%) translateX(-50%);
      transform: translateY(-86%) translateX(-50%);
    }

    #level1 .tools .hose .hitbox img {
      -webkit-transform: scaleY(-1);
      -moz-transform: scaleY(-1);
      -ms-transform: scaleY(-1);
      -o-transform: scaleY(-1);
      transform: scaleY(-1);
      display: none;
    }

    #level1 .tools .detergent {
      /* display: block; */
      top: 80%;
      left: 45%;
      width: 11%;
    }

    #level1 .tools .detergent .hitbox {
      width: 47%;
      height: 24%;
      left: 72%;
      top: -2%;
    }

    #level1 .splash {
      position: absolute;
      width: 16%;
      height: 29%;
      -o-object-fit: contain;
      object-fit: contain;
      z-index: 100;
      opacity: 0.2;
    }

    #level1 .tools .mop {
      top: 80%;
      left: 45%;
      width: 16%;
    }

    #level1 .tools .mop .hitbox {
      width: 100%;
      height: 12%;
      left: 0%;
      top: 0%;
    }

    #level1 .bubble {
      position: absolute;
      width: 16%;
      height: 29%;
      -o-object-fit: contain;
      object-fit: contain;
      z-index: 100;
      opacity: 0.2;
    }
  </style>
</head>

<body>
  <div class="game">
    <div class="level" id="level1" data-file-bg="bg.jpg">
      <audio id="theme" data-file="theme.mp3"></audio>

      <audio data-sound="brush" data-file="sound-brush.mp3"></audio>
      <audio data-sound="put-brush" data-file="put-brush.mp3"></audio>

      <audio data-sound="water" data-file="water.mp3"></audio>
      <audio data-sound="spray" data-file="spray.mp3"></audio>
      <audio data-sound="mop" data-file="mop.mp3"></audio>



      <div class="main">
        <img data-file="hand.png" draggable="false" class="hand" alt="" />



        <img data-file="Carpet.png" class="carpet" draggable="false" alt="" />
        <img data-file="blob.png" class="blob" draggable="false" alt="" />

        <canvas class="fur" id="fur"></canvas>

        <div class="tools">
          <div data-item="brush" class="tool brush">
            <div class="hitbox"></div>

            <img data-file="brush.png" draggable="false" alt="">
          </div>

          <div data-item="hose" class="tool hose">
            <div class="hitbox">
              <img data-file="water-7665 (1).gif" draggable="false" alt="">
            </div>


            <img data-file="fire_department_part_1_30.png" draggable="false" alt="">
          </div>

          <div data-item="detergent" class="tool detergent">
            <div class="hitbox"></div>
            <img data-file="176c1684-e80e-4900-b7fd-8984de16bf1a-removebg-preview.png" draggable="false" alt="">
          </div>


          <div data-item="mop" class="tool mop">
            <div class="hitbox"></div>
            <img data-file="mop.png" draggable="false" alt="">
          </div>

        </div>
      </div>
    </div>

    <div id="popup" data-file-bg="popup-bg.jpg">
      <div>
        <img data-file="Kitchen.png" draggable="false" alt="Логотип игры" />
        <h2>Find Sort Match</h2>
        <button data-file-bg="button-bg.jpg" id="download-btn">Download</button>
      </div>
    </div>
  </div>

  <!-- Добавим все base64 в src -->
  <script>
    Object.keys(assetsPackage).forEach(file => {
      const elements = document.querySelectorAll(`[data-file='${file}']`)
      const elementsBg = document.querySelectorAll(`[data-file-bg='${file}']`)
      if (elements.length) {
        Array.from(elements).forEach(el => {
          console.log(file);

          el.src = assetsPackage[file]
        })
      } else if (elementsBg.length) {
        Array.from(elementsBg).forEach(el => {
          el.style.backgroundImage = `url(${assetsPackage[file]})`
        })
      } else if (file.includes('ttf')) {
        const style = document.createElement('style');
        style.textContent = `
    @font-face {
      font-family: ${file.split('-')[0]};
      src: url(${assetsPackage[file]}) format('Truetype');
    }`;

        document.head.appendChild(style);
      }
    })
  </script>

  <script>
    const popup = document.getElementById('popup')
    const buttonDownload = popup.querySelector('button')
    buttonDownload.addEventListener('click', () => {
      window.FbPlayableAd && FbPlayableAd.onCTAClick();
      window.install && window.install();
      window.mraid && mraid.open && mraid.open("https://play.google.com/store/apps/details?id=com.gan.puzzleone");
      window.ExitApi && ExitApi.exit()
    })

    const audios = document.querySelectorAll('audio')
    audios.forEach(audio => audio.volume = 0.15)

    const theme = document.getElementById('theme')
    theme.volume = 0.4
    theme.onended = () => theme.play()
    document.addEventListener('mousedown', () => theme.play())
    document.addEventListener('touchstart', () => theme.play())


    const levels = document.querySelectorAll('.level')
    function selectLevel(id) {
      levels.forEach(level => {
        if (level.id === id) {
          level.style.display = 'flex'
        } else {
          level.style.display = 'none'
        }
      })
    }

    function isIntersecting(el1, ...elements) {
      const rect1 = el1.getBoundingClientRect();
      let maxIntersection = 0;
      let bestMatch = [];

      elements.forEach(el => {
        const rect2 = el.getBoundingClientRect();

        const xOverlap = Math.max(0, Math.min(rect1.right, rect2.right) - Math.max(rect1.left, rect2.left));
        const yOverlap = Math.max(0, Math.min(rect1.bottom, rect2.bottom) - Math.max(rect1.top, rect2.top));

        const intersectionArea = xOverlap * yOverlap;

        if (intersectionArea > maxIntersection) {
          maxIntersection = intersectionArea;
          bestMatch.push(el);
        }
      });

      if (!bestMatch.length) {
        bestMatch = false
      }

      if (bestMatch.length === 1) {
        bestMatch = bestMatch[0]
      }

      return bestMatch;
    }


    function handTutorial(hand, position) {

      hand.style.opacity = 1
      hand.style.left = position.leftStart
      hand.style.top = position.topStart
      hand.style.transition = "opacity 0.3s ease 0s"


      setTimeout(() => {
        hand.style.transition = "all 1s ease 0s"

        hand.style.left = position.leftEnd
        hand.style.top = position.topEnd

        setTimeout(() => {
          hand.style.left = position.leftStart
          hand.style.top = position.topStart

          setTimeout(() => {
            hand.style.left = position.leftEnd
            hand.style.top = position.topEnd

            setTimeout(() => {
              hand.style.opacity = 0
              setTimeout(() => {
                hand.style.zIndex = -100
              }, 500);
            }, 500);
          }, 1000);
        }, 1000);
      }, 1000);

    }


    //  LEVEL 1 
    function level1() {
      const level = document.querySelector('#level1')
      const main = level.querySelector('.main')
      const items = level.querySelectorAll('.tools > .tool')
      const hand = level.querySelector('.hand')
      let gameIsEnd = false

      const tools = {
        brush: level.querySelector('.brush'),
        hose: level.querySelector('.hose'),
        detergent: level.querySelector('.detergent'),
        mop: level.querySelector('.mop'),
      }

      handTutorial(level.querySelector('.hand'),
        {
          leftStart: '48%',
          topStart: '88%',
          leftEnd: '48%',
          topEnd: '50%',
        })


      items.forEach(item => {
        // Drag and drop       
        function dragDrop(e) {
          e.preventDefault()



          hand.style.opacity = 0
          setTimeout(() => {
            hand.style.zIndex = -100
          }, 600);



          item.style.transform = 'none'

          const mainRect = main.getBoundingClientRect();
          const rect = item.getBoundingClientRect();

          let offsetX
          let offsetY

          if (e.touches) {
            offsetX = e.touches[0].clientX - rect.left;
            offsetY = e.touches[0].clientY - rect.top;
          } else {
            offsetX = e.clientX - rect.left;
            offsetY = e.clientY - rect.top;
          }


          function moveAt(e) {

            if (gameIsEnd) {
              return;
            }

            let left, top
            if (e.touches) {
              left = e.touches[0].pageX - mainRect.left - offsetX
              top = e.touches[0].pageY - mainRect.top - offsetY
            } else {
              left = e.pageX - mainRect.left - offsetX
              top = e.pageY - mainRect.top - offsetY
            }
            item.style.left = left + 'px'
            item.style.top = top + 'px'


            const hitbox = item.querySelector('.hitbox')

            if (item.dataset.item === "brush" && isIntersecting(hitbox, canvas)) {

              const hitboxRect = hitbox.getBoundingClientRect()

              const x = hitboxRect.x + hitboxRect.width / 2
              const y = hitboxRect.y

              ctx.erace(x, y)
            } else if (item.dataset.item === "hose" && item.dataset.step === "1") {
              if (level.querySelector('.blob').style.opacity < 0.6) {

                level.querySelector('.blob').style.opacity = +level.querySelector('.blob').style.opacity + 0.003

              }

            } else if (item.dataset.item === 'detergent' && isIntersecting(hitbox, canvas)) {
              const splash = document.createElement('img')

              splash.classList.add('splash')
              splash.src = assetsPackage['paint.png']
              splash.style.pointerEvents = 'none'
              splash.style.left = left + hitbox.offsetLeft - hitbox.clientWidth / 2 + 'px'
              splash.style.top = top + hitbox.offsetTop - hitbox.clientHeight + 'px'

              main.appendChild(splash)

            } else if (item.dataset.item === "hose" && item.dataset.step === "2") {
              const splashes = level.querySelectorAll('.splash')
              const bubbles = level.querySelectorAll('.bubble')

              const intersectingSplashes = isIntersecting(hitbox, ...splashes);
              const intersectingBubbles = isIntersecting(hitbox, ...bubbles);



              if (intersectingSplashes && intersectingSplashes.length) {
                intersectingSplashes.forEach(splash => {
                  splash.remove()
                })
              }

              if (intersectingBubbles && intersectingBubbles.length) {
                intersectingBubbles.forEach(bubble => {
                  bubble.remove()
                })
              }


              if (splashes.length <= 135 && bubbles.length <= 135) {
                gameIsEnd = true
                level.style.pointerEvents = 'none'
                popup.classList.add('active')
                window.gameEnd && window.gameEnd();
                return
              }
            } else if (item.dataset.item === "mop" && isIntersecting(hitbox, canvas)) {
              const bubble = document.createElement('img')

              bubble.classList.add('bubble')
              bubble.src = assetsPackage['bubble.png']
              bubble.style.pointerEvents = 'none'
              bubble.style.left = left + hitbox.offsetLeft + 'px'
              bubble.style.top = top + hitbox.offsetTop - hitbox.clientHeight + 'px'

              main.appendChild(bubble)
            }


            if (item.dataset.item === "brush") {
              const sound = document.querySelector('[data-sound="brush"]')
              if (sound.pause) {
                sound.play()
              }

            } else if (item.dataset.item === "hose") {
              const sound = document.querySelector('[data-sound="water"]')
              if (sound.pause) {
                sound.play()
              }
              hitbox.querySelector('img').style.display = 'block'
            } else if (item.dataset.item === "detergent") {
              const sound = document.querySelector('[data-sound="spray"]')
              if (sound.pause) {
                sound.play()
              }

            } else if (item.dataset.item === "mop") {
              const sound = document.querySelector('[data-sound="mop"]')
              if (sound.pause) {
                sound.play()
              }
            }
          }

          document.onmousemove = document.ontouchmove = function (e) {
            moveAt(e);
          }

          document.onmouseup = document.ontouchend = function (e) {
            document.onmousemove = document.ontouchmove = null
            document.onmouseup = document.ontouchend = null


            if (item.dataset.item === "brush" && getClearedPercentage() >= 97) {
              tools.brush.style.display = 'none'
              tools.brush.style.left = null
              tools.brush.style.top = null

              tools.hose.style.display = 'block'
              tools.hose.dataset.step = 1
            } else if (item.dataset.item === "hose" && item.dataset.step != 2) {

              if (level.querySelector('.blob').style.opacity >= 0.6) {
                tools.hose.style.display = 'none'
                tools.hose.style.left = null
                tools.hose.style.top = null

                tools.detergent.style.display = 'block'
                level.querySelector('.blob').dataset.wash = false
              }

            } else if (item.dataset.item === "detergent") {
              const splashes = level.querySelectorAll('.splash')

              if (splashes.length >= 450) {

                tools.detergent.style.display = 'none'
                tools.detergent.style.left = null
                tools.detergent.style.top = null

                tools.mop.style.display = 'block'
              }
            } else if (item.dataset.item === "mop") {

              const bubbles = level.querySelectorAll('.bubble')

              if (bubbles.length >= 450) {

                tools.mop.style.display = 'none'
                tools.mop.style.left = null
                tools.mop.style.top = null

                tools.hose.style.display = 'block'
                tools.hose.dataset.step = 2
              }


            }

            if (item.dataset.item === "brush") {
              ctx.lastX = undefined;
              ctx.lastY = undefined;
              document.querySelector('[data-sound="put-brush"]').play()
              document.querySelector('[data-sound="brush"]').pause()
            } else if (item.dataset.item === "hose") {
              tools.hose.querySelector('.hitbox img').style.display = 'none'
              document.querySelector('[data-sound="water"]').pause()
            } else if (item.dataset.item === "detergent") {
              document.querySelector('[data-sound="spray"]').pause()
            } else if (item.dataset.item === "mop") {
              document.querySelector('[data-sound="mop"]').pause()
            }




          }
        }

        item.onmousedown = item.ontouchstart = dragDrop
      })




    }



    const canvas = document.querySelector('.fur');
    const ctx = canvas.getContext('2d');


    function draw() {


      ctx.eraceSquare = function (x, y, width, height) {
        this.fillRect(x - width / 2, y - height / 2, width, height);
      };

      ctx.erace = function (pageX, pageY) {
        const rect = canvas.getBoundingClientRect();
        const scaleX = canvas.width / rect.width;
        const scaleY = canvas.height / rect.height;

        const x = (pageX - rect.left) * scaleX;
        const y = (pageY - rect.top) * scaleY;
        const width = window.innerWidth * 0.15;
        const height = 15;
        const fillColor = '#ff0000';
        ctx.globalCompositeOperation = 'destination-out';

        if (ctx.lastX !== undefined && ctx.lastY !== undefined) {
          const dx = x - ctx.lastX;
          const dy = y - ctx.lastY;
          const distance = Math.sqrt(dx * dx + dy * dy);
          const steps = Math.ceil(distance / (height / 2)); // Чем меньше шаг, тем плотнее стирание

          for (let i = 0; i <= steps; i++) {
            const interpolatedX = ctx.lastX + (dx * i) / steps;
            const interpolatedY = ctx.lastY + (dy * i) / steps;
            ctx.eraceSquare(interpolatedX, interpolatedY, width, height);
          }
        } else {
          ctx.eraceSquare(x, y, width, height);
        }

        ctx.lastX = x;
        ctx.lastY = y;

        // ctx.eraceSquare(x, y, width, height);
      }

      canvas.width = window.innerWidth * 0.92;
      canvas.height = window.innerHeight;
      const img = new Image();
      img.src = assetsPackage['fur.png'];
      img.onload = function () {
        ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
      };
    }

    function getClearedPercentage() {
      const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
      const pixels = imageData.data;
      let transparentPixels = 0;
      const totalPixels = pixels.length / 4; // Каждый пиксель состоит из 4 значений (R, G, B, A)

      for (let i = 3; i < pixels.length; i += 4) {
        if (pixels[i] === 0) transparentPixels++; // Проверяем альфа-канал (прозрачность)
      }

      return (transparentPixels / totalPixels) * 100; // Рассчитываем процент
    }

    if (window.mraid) {
      if (mraid.getState() === "default") {
        level1()
      } else {
        mraid.addEventListener("viewableChange", function (viewable) {
          if (viewable) level1();
        });
      }
    }

    draw()

    function gameStart() {
      level1()
    }
    function gameClose() { }


    window.addEventListener("load", () => {
      gameStart()
      window.gameReady && window.gameReady();
    })


  </script>

        document.write('<scr' + 'ipt src="' + src + '"></scr' + 'ipt>');
        document.write('<scr' + 'ipt>eruda.init();</scr' + 'ipt>');
      })();
  </script>
